import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './Home';
import Schedule from './Schedule';
import { Container, Navbar, Nav } from 'react-bootstrap'; // Importar componentes de Bootstrap

function App() {
  return (
    <Router>
      {/* Barra de navegaci√≥n usando Bootstrap */}
      <Navbar bg="dark" variant="dark" expand="lg">
        <Container>
          <Navbar.Brand href="/">Game Schedule</Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="/">Home</Nav.Link>
            <Nav.Link href="/games">Schedule</Nav.Link>
          </Nav>
        </Container>
      </Navbar>

      {/* Contenido de las rutas */}
      <Container className="mt-4">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/games" element={<Schedule />} />
        </Routes>
      </Container>
    </Router>
  );
}

export default App;
